import React from "react";

const Cartoon = (props) => {
  return (
    <li>
      <img src={props.cartoon.image} alt={props.cartoon.name} />
      <h1 className="cartoon-list"> {props.cartoon.name} </h1>
      <p> {props.cartoon.species}</p>
    </li>
  );
};

export default Cartoon;
